import React, { Component } from "react";
import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import Headerone from "./components/global/header_one";
import Footer from "./components/global/footer";
import Alertdialog from './components/global/dialogbox';
import Loadingicon from "./components/global/loading_icon";
import Module from "./components/module";



class App extends Component {

  state = {
    module:"biomuta",
    conf:{
      global:{},
      module:{}
    },
    isLoadedOne:false,
    isLoadedTwo:false,
    dialog:{
      status:false, 
      msg:""
    }
  };

  handleDialogClose = () => {
    var tmpState = this.state;
    tmpState.dialog.status = false;
    this.setState(tmpState);
  }

  componentDidMount() {
  }


  render() {


    if (this.state.isLoadedOne === false || this.state.isLoadedTwo === false){
      return <Loadingicon/>
    }



    return (
      <div>
      <Alertdialog dialog={this.state.dialog} onClose={this.handleDialogClose}/>
      <Headerone config={this.state.conf.global}/>
      <Router>
        <Switch>
          <Route
            path="/:pageId"
            render={(props) => (
              <Module config={this.state.conf.module} pageId={props.match.params.pageId}/>
            )}
          />
          <Route
            exact
            path="/"
            render={(props) => (
              <Module config={this.state.conf.module} pageId={"home"}/>
            )}
          />
        </Switch>
      </Router>
      <Footer />
      </div>
    );


  }
}

export default App;
